import React, { useContext, useState } from "react";
import ProductList from "../components/ProductList";
import {
  CustomContextProvider,
  FavouritesContext,
  useFavouritesContext,
} from "../context/FavouritesContext.js";

export default function FavouritesPage({ errorHandler }) {
  const { favContext, handleFavContext } = useFavouritesContext();
  return (
    <FavouritesContext.Provider value={(favContext, handleFavContext)}>
      <ProductList errorHandler={errorHandler} />
    </FavouritesContext.Provider>
  );
}
